package breeze.numerics.constants

import scala.collection.immutable.HashMap

/**Object encapsulating CODATA2010 constants.
 * @author ktakagaki
 * @date 3/12/14.
 */
object Database {


  def value(string: String) = databaseHM(string)

  def search(regexString: String) = databaseHM.filter(
    (key: (String, (Double, Double, String))) => regexString.r.findFirstIn(key._1).isInstanceOf[Some]
  )

  def searchValue(regexString: String) = search(regexString).map(
    (key: (String, (Double, Double, String))) => (key._1, key._2._1)
  ).toList

  def searchUncertainty(regexString: String) = search(regexString).map(
    (key: (String, (Double, Double, String))) => (key._1, key._2._2)
  ).toList

  def searchUnit(regexString: String) = search(regexString).map(
    (key: (String, (Double, Double, String))) => (key._1, key._2._3)
  ).toList


